import React from 'react';

import '../../styles/components/video/_video-select.scss';

export default function VideoSelect() {

	return (
		<div className='video-select__wrapper'>
			<h5 className='title-block light'><span>Videos</span></h5>
			<div className="video-select">
				<select className='city-select' >
					<option value="OK">CTV</option>
					<option value="OK">CityTV</option>
					<option value="OK">Global News</option>
					<option value="OK">CBC News</option>
				</select>
				<span className='helper'></span>
			</div>
		</div>
	)

}
